goog.provide("goog.ui.MenuSeparatorRendererTest");goog.setTestOnly("goog.ui.MenuSeparatorRendererTest");goog.require("goog.dom");goog.require("goog.testing.jsunit");goog.require("goog.ui.MenuSeparator");goog.require("goog.ui.MenuSeparatorRenderer");var sandbox,originalSandbox;function setUp(){sandbox=goog.dom.getElement("sandbox");originalSandbox=sandbox.cloneNode(!0)}function tearDown(){sandbox.parentNode.replaceChild(originalSandbox,sandbox)}function testDecorate(){var separator=new goog.ui.MenuSeparator,dummyId="foo";separator.setId(dummyId);assertEquals(dummyId,separator.getId());var renderer=new goog.ui.MenuSeparatorRenderer;renderer.decorate(separator,goog.dom.getElement("separator"));assertEquals("separator",separator.getId())}